"Diffusion pipelines are a collection of interchangeable schedulers and models that can be mixed and matched to tailor a pipeline to a specific use case. The scheduler encapsulates the entire denoising process such as the number of denoising steps and the algorithm for finding the denoised sample. A scheduler is not parameterized or trained so they don’t take very much memory. The model is usually only concerned with the forward pass of going from a noisy input to a less noisy sample.",S,j,oe='This guide will show you how to load schedulers and models to customize a pipeline. You’ll use the <a href="https://hf.co/stable-diffusion-v1-5/stable-diffusion-v1-5" rel="nofollow">stable-diffusion-v1-5/stable-diffusion-v1-5</a> checkpoint throughout this guide, so let’s load it first.',k,I,fe,x,Ye="You can see what scheduler this pipeline uses with the <code>pipeline.scheduler</code> attribute.",me,R,he,B,Me,C,Pe='Schedulers are defined by a configuration file that can be used by a variety of schedulers. Load a scheduler with the <a href="/docs/diffusers/v0.33.1/en/api/schedulers/overview#diffusers.SchedulerMixin.from_pretrained">SchedulerMixin.from_pretrained()</a> method, and specify the <code>subfolder</code> parameter to load the configuration file into the correct subfolder of the pipeline repository.',ye,X,Ae='For example, to load the <a href="/docs/diffusers/v0.33.1/en/api/schedulers/ddim#diffusers.DDIMScheduler">DDIMScheduler</a>:',be,E,ge,F,Ke="Then you can pass the newly loaded scheduler to the pipeline.",we,H,Je,N,Ze,z,Oe="Schedulers have their own unique strengths and weaknesses, making it difficult to quantitatively compare which scheduler works best for a pipeline. You typically have to make a trade-off between denoising speed and denoising quality. We recommend trying out different schedulers to find one that works best for your use case. Call the <code>pipeline.scheduler.compatibles</code> attribute to see what schedulers are compatible with a pipeline.",Ue,L